import React, { Component } from "react";
import { Container, Col, Row, Button } from "react-bootstrap";

class BonoLoto extends Component {
  constructor(props) {
    super(props);
    // this._service = new EuroService();
    this.state = {};
  }

  generateButtons(start, end) {
    let arrButtons1 = [];
    for (let i = start; i <= end; i++) {
      arrButtons1.push(
        <div variant="dark" type="submit">
          {i}
        </div>
      );
    }
    return arrButtons1;
  }

  render() {
    return (
      <Container>
        <section>
          <h1>BonoLoto</h1>
        </section>
        <h3>1</h3>
        <Row>
          <Col xs={1}>{this.generateButtons(1, 9)}</Col>
          <Col xs={1}>{this.generateButtons(10, 20)}</Col>
          <Col xs={1}>{this.generateButtons(21, 30)}</Col>
          <Col xs={1}>{this.generateButtons(31, 40)}</Col>
          <Col xs={1}>{this.generateButtons(41, 50)}</Col>
        </Row>
      </Container>
    );
  }
}

export default BonoLoto;
